import React, { Component } from 'react'
import Mean from './pages/index'
class App extends Component {
  state = {

  }

  renderContent = () => {
    <Route exact path = "/" component = {props =>
      <IndexPage {...props} notes = {this.state.notes} />}>
    </Route>
  }
  render() {
    return (
      <div>
        <Mean/>
        {this.renderContent()}
      </div>      
    )
  }
}

export default App
